const pinStyle = {
  fill: "#FC5E53",
  stroke: "#ffffff",
};

export default class Pin extends PureComponent {
  render() {
    return (
      <svg
        className="Pin"
        width="65"
        height="65"
        viewBox="0 0 29 28"
        style={pinStyle}
      >
        <path d={ICON} />
      </svg>
    );
  }
}
